import TopCategories from "../Components/TopCategories";
const Home = () => {
  return (
    <>
      <HeroSection />
      <StatisticsHome />
      <WhyChooseUs />
      <LatestCourses />
      <TopCategories />
    </>
  );
};

export default Home;
